import React from 'react'
import classes from './../'

interface FormProps {
    idInstance: string;
    apiTokenInstance: string;
    friendNumber: string;
    setIdInstance: Function;
    setApiTokenInstance: Function;
    setFriendNumber: Function;
    isButtonClicked: boolean;
    setIsButtonClicked: Function;
}

const Form: React.FC<FormProps> = ({idInstance,setIdInstance,apiTokenInstance,setApiTokenInstance,friendNumber,setFriendNumber,isButtonClicked,setIsButtonClicked}) => {
  
    return (
        <div className='flex flex-col w-[800px] m-auto relative top-[300px] bg-white rounded-lg'>
            <input className='bg-gray-200 placeholder-gray-600 p-[20px] m-[10px] rounded-xl' type='text' placeholder='Enter your id instance' value={idInstance} onChange={(e) => setIdInstance(e.target.value)}></input>
            <input className='bg-gray-200 placeholder-gray-600 p-[20px] m-[10px] rounded-xl' type='text' placeholder='Enter your api token instance' value={apiTokenInstance} onChange={(e) => setApiTokenInstance(e.target.value)}></input>
            <input className='bg-gray-200 placeholder-gray-600 p-[20px] m-[10px] rounded-xl mb-[50px]' type='text' placeholder='Enter your friend number' value={friendNumber} onChange={(e) => setFriendNumber(e.target.value)}></input>
            <button className=' bg-blue-500 text-white p-[20px] rounded-3xl m-[10px]' onClick={() => setIsButtonClicked(!isButtonClicked)}>Generate chat</button>
        </div>
    )
}

export default Form;
